pub enum Curve<X, Y> {
    Dots {
            x: X,
            y: Y,
        },
    Impulses {
            x: X,
            y: Y,
        },
    Lines {
            x: X,
            y: Y,
        },
    LinesPoints {
            x: X,
            y: Y,
        },
    Points {
            x: X,
            y: Y,
        },
    Steps {
            x: X,
            y: Y,
        },
}

pub enum ErrorBar<X, Y, L, H> {
    XErrorBars {
            x: X,
            y: Y,
            x_low: L,
            x_high: H,
        },
    XErrorLines {
            x: X,
            y: Y,
            x_low: L,
            x_high: H,
        },
    YErrorBars {
            x: X,
            y: Y,
            y_low: L,
            y_high: H,
        },
    YErrorLines {
            x: X,
            y: Y,
            y_low: L,
            y_high: H,
        },
}

pub enum Position {
    Inside(Vertical, Horizontal),
    Outside(Vertical, Horizontal),
}

pub enum VersionError {
    Exec(io::Error),
    Error(String),
    OutputError,
    ParseError(String),
}
